store.dispatch(
  addExpense({
    id: 1,
    amount: 45
  })
);

store.dispatch(
  addExpense({
    id: 2,
    amount: 20
  })
);

store.dispatch(
  addExpense({
    id: 3,
    amount: 30
  })
);

store.dispatch(
  removeExpense({
    id: 2
  })
);

console.assert(store.getState().balance === 75);
console.assert(store.getState().expenses.length === 2);

